import React from "react";

function Checkbox({ childCheckboxData, handleIndividualCheckboxChange }) {
  return (
    <div>
      <input
        type="checkbox"
        checked={childCheckboxData.isChecked}
        onChange={(event) =>
          handleIndividualCheckboxChange(event, parentIndex, childIndex)
        }
      />
    </div>
  );
}

export default Checkbox;
